import React from 'react';
import PeopleCard from './PeopleCard'



const PeopleList = ({hero}) => {

	return (

		<div>
		{ 

			hero.map((people,i) => {
				return (
					<PeopleCard
					key={i}
					id={Hero[i].id}
					name={Hero[i].name}
					gender={Hero[i].gender}
					height={Hero[i].height}
					mass={Hero[i].mass}
					/>

					);
			})

		}
		</div>
		)
		}


export default PeopleList
